import React from "react";
import "./App.css";
import TradingViewWidget from "./Charts/tradingview-widget/TradingviewWidget";

function App() {
  return (
    <div>
      <div style={{ height: 850 }}>
        <TradingViewWidget />
      </div>
      <div className="mt-3 d-flex justify-content-end">
        <div>
          <button type="button" className="mr-3 btn btn-primary">Start</button>
          <button type="button" className="btn btn-dark">End</button>
        </div>      
      </div>
    </div>
  );
}

export default App;
